import React from 'react';
import THead from './THead';
import TBody from './TBody';
import Tr from './Tr';
const index = ({tbodyData, theadData}) => {
	const tbodyDataRender = tbodyData.map((data) => <Tr data={data} />);
	return (
		<table className="table table-bordered table-hover table-striped text-center" style={{width: '50%', height: '50%'}}>
			<thead>
				<tr className="dark">
					<td>link</td>
					<td>pics</td>
					<td>name</td>
					<td>id</td>
				</tr>
			</thead>
			{tbodyDataRender}
		</table>
	);
};

export default index;
